create table company_similar
(
    id           bigserial
        constraint company_similar_pk
            primary key,
    company_name varchar(255)
        constraint company_similar_crypto_company_name_fk
            references crypto_company (name),
    similar_name text
        constraint company_similar_name_crypto_company_name_fk
            references crypto_company (name)
);

alter table company_similar
    owner to application;

create unique index company_similar_id_uindex
    on company_similar (id);

